import Nav from './components/Nav';

function App() {
  const [pickUpLocation, setPickUpLocation] = useState([])

  return (
    <React.Fragment>
      <div className="App">
        {/* <Nav /> */}
        <Route exact path="/" component={LandingPage} />
        <Route exact path="/carselect" component={SelectACar} />
      </div>
    </React.Fragment>
  );
}


export default withRouter(App)
